def addDictList(d, key, val):
    if key not in d: d[key] = []
    d[key].append(val)

def addDictInt(d, key, val):
    if key not in d: d[key] = 0
    d[key] = val

def addDictCount(d, key):
    if key not in d: d[key] = 0
    d[key] += 1

def addDictSum(d, key, val):
    if key not in d: d[key] = 0
    d[key] += val

