def dfs(g, u, visited, call_stack):
    visited[u] = True
    call_stack.add(u)
    for v in g[u]:
        if v in call_stack:
            return [u, v]
        if not visited[v]:
            d = dfs(g, v, visited, call_stack)
            call_stack.discard(v)
            if d is not None:
                return [u] + d
    return None


