def line(p1, p2):
    x1, y1 = p1
    x2, y2 = p2
    a = y2 - y1
    b = x1 - x2
    c = x2 * y1 - x1 * y2
    if a < 0:
        a, b, c = -a, -b, -c
    if a == 0:
        if b < 0:
            b, c = -b, -c
        if c == 0:
            b = 1
        else:
            g = abs(gcd(b, c))
            b, c = b // g, c // g
    else:
        if b == 0:
            if c == 0:
                a = 1
            else:
                g = abs(gcd(a, c))
                a, c = a // g, c // g
        else:
            if c == 0:
                g = abs(gcd(a, b))
                a, b = a // g, b // g
            else:
                g = abs(gcd(gcd(a, b), c))
                a, b, c = a // g, b // g, c // g
    return a, b, c

def belongs(pi, l):
    a, b, c = l
    return a * pi[0] + b * pi[1] + c == 0

def nb_points(l, p):
    return sum(1 for pi in p if belongs(pi, l))

def colinear(p):
    if len(p) <= 2:
        return True
    l = line(p[0], p[1])
    return all(belongs(pi, l) for pi in p[2:])

