def solve():
    n = int(sys.stdin.readline().rstrip())
    a = [int(i) for i in sys.stdin.readline().split()]
    Adj = [[] for i in range(n)]

    for i in range(n - 1):
        u, v = map(int, sys.stdin.readline().split())
        u, v = u-1, v-1
        Adj[u].append(v)
        Adj[v].append(u)

    max_v = max(a)
    max_n = a.index(max_v)
    num_m = sum(ai == max_v for ai in a)

    if num_m == 1:
        ans = max_v

        rinsetu = [False] * n

        for u in Adj[max_n]:
            rinsetu[u] = True

        rinsetu[max_n] = True

        for u in range(n):
            if rinsetu[u]:
                continue
            if a[u] == max_v - 1:
                ans = max_v + 1
                break
    else:
        for u in range(n):
            cnt = 0

            if a[u] == max_v:
                cnt += 1

            for v in Adj[u]:
                if a[v] == max_v:
                    cnt += 1

            if cnt == num_m:
                ans = max_v + 1
                break
        else:
            ans = max_v + 2

    print(ans)


