def preproc(str, leng):
	li = []
	res = [-1]*leng
	for i in range(leng):
		if str[i] == '(':
			li.append(i)
		else:
			start, end = li.pop(), i
			res[start] = end
			res[end] = start
	return res

def delete(flags, cursor, pairs):
	pos = pairs[cursor]
	direction = 1 if pos > cursor else -1
	while(pos+direction > 0 and pos+direction < len(flags) and flags[pos+direction] != -1):
		pos = flags[pos+direction]
	return pos

